import { VscGithubInverted } from "react-icons/vsc";
import './Header.css'
import React from 'react';
import { Button, Container, Form, FormControl, Nav, Navbar, NavDropdown } from 'react-bootstrap';

const Header = () => {
    return (
        <Container fluid>
            <Container>
                <Navbar expand="lg">
                    <Navbar.Brand href="#home"><img src="https://iili.io/27JGwB.png" width="100" className="d-inline-block align-top"alt=""/></Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="ml-auto">
                            <Nav.Link  className="navLink" href="#home" bg="dark"><VscGithubInverted /></Nav.Link>
                            <Nav.Link href="#link" className="navLink font-weight-bold">Login</Nav.Link>
                            <button className="mainButton">Sign up</button>
                        </Nav>
                    </Navbar.Collapse>
                </Navbar>
            </Container>
        </Container>
    );
};

export default Header;
